import { TextField } from '@mui/material'
import React from 'react'

function Login() {
  return (
    <div className='parentLogin'>
        <div className='btn__Code'>
          <TextField label='Code' variant='filled'></TextField>
        </div>
    </div>
  )
}

export default Login
